These are very cool clips.  I will try again using your advice to kind of
zone out as if in a crowd.

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
bhali333
Sent: Thursday, March 27, 2008 1:55 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] listening to posts




I know everybody including myself says&quot;oh no not another 10 files to 
listen too&quot; but I think these files from this new method are worth the 
effort.

Give a listen and lets start getting some opinions on this new EVPM 
method.

bruce




